hcl.init()


dtype_temp = hcl.Fixed(16, 16)
def bnn_main(INPUT, w_conv1, threshold):
    #input_pad = nn.pad(input,2,2,0) #conv2d_nchw has the pad function within it
    #conv2 takes 4 dimensions inputs
    conv1 = bnn.conv2d_nchw(INPUT,w_conv1, padding=[1, 1], name="conv1", out_dtype=hcl.Int(6))#out_dtype =dtype_temp # padding=[0, 0]
    print("begin")
    #print(conv1.shape)
    conv1_thresh = bnn.batch_norm_threshold(conv1,threshold, name="conv1_thresh")
    #print(conv1_thresh.shape)
    conv1_pool = bnn.max_pool2d_nchw(conv1_thresh,[2, 2], [2, 2], name="conv1_pool" )
    #print(conv1_pool.shape)
    #return conv1_pool
    return conv1_thresh

